import { Layout } from "../components";
import styles from "../styles/Home.module.css";

export default function Home() {
  return (
    <Layout>
      <p>
        We find common ground in the desire to improve the quality of our
        democracy. Our political systems should be inclusive, transparent and
        responsive. We are a group of students at Boston College Law School
        dedicated to studying democracy, and promoting it’s preservation and
        expansion. We advocate for faith in democracy, and for democratic
        structures worthy of faith. Our 2021 Priorities H3033 – Election Day
        Registration H4603 – Campaign Finance – Constitutional Amendment H5055 –
        Political Advertisement Disclosure Our Advocacy Maps
      </p>
    </Layout>
  );
}
